import React from "react";
import { useParams } from "react-router-dom";

const UserDetails = () => {
  const params = useParams();
  const { name } = params;

  return (
    <div>
      <h1>UserDetails</h1>
      <h2> This is {name} Users data.</h2>
    </div>
  );
};

export default UserDetails;
